import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import Home from "./components/Home";


function App() {
  return (
    <div style="background-image: url('https://mdbcdn.b-cdn.net/img/new/standard/city/041.webp');" className="container-fluid">
      <div class="overlay">
      <Router>
        <NavBar />
        <Routes>
          <Route exact path="/" element={<Home/>} />

        </Routes>
      </Router>
      </div>
    </div>
  );
}

export default App;
